import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const d= new Date().toLocaleDateString();
const t= new Date().toLocaleTimeString();
const img1="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages.unsplash.com%2Fphoto-1475274047050-1d0c0975c63e%3Fixid%3DMnwxMjA3fDB8MHxzZWFyY2h8MXx8bmlnaHQlMjBza3l8ZW58MHx8MHx8%26ixlib%3Drb-1.2.1%26w%3D1000%26q%3D80&imgrefurl=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fnight-sky&tbnid=2aNO91lYtAB7DM&vet=12ahUKEwiq_Ifv6trwAhVVcX0KHd7LAYAQMygBegUIARDXAQ..i&docid=eQ2aZrNiE_ZC_M&w=1000&h=666&q=stars%20in%20sky%20images&ved=2ahUKEwiq_Ifv6trwAhVVcX0KHd7LAYAQMygBegUIARDXAQ"
ReactDOM.render(
    <div>
    <h1 className="heading" >Hello, my name is prashant kumar</h1>
      <p>current date={d}</p>
      <img src={img1} />
      <p>current time= {t} </p>
    </div>,
    document.getElementById('root')
);
